import './Cell.css'
import React from "react";

const Cell = ({ value }) => {
  return (
    <div style={cellStyle}>
      {value}
    </div>
  );
};

const cellStyle = {
  width: "40px",
  height: "40px",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  border: "1px solid black",
  fontSize: "18px",
};

export default Cell;
